description:
Dodge &amp; Fuski return to form with an absolutely killer (pun very much intended) A/B side to round out 2014. On the A side we have the no-holds-barred dance floor destroyer Killer Bees, a blueprint of what you can expect from D&amp;F in the coming months after their year long Glitch Hop hiatus, and on the flip we have Vibes, a tribute to the sound of 2010 and a nod to some of their favourite dubstep pioneers at the time. With USA and Australian tours lined up before the year comes to a close, there couldn't be more perfect timing for Dodge &amp; Fuski to return to the genre that got them to where they were in the first place. Keep it locked for much more like this coming your way soon...
